    [],nt"num_tags": 7,nt"name": "progress-report-waterfowl-breeding-ground-aerial-surveys-in-southern-saskatchewan-1961",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes the Waterfowl Breeding
    Population and Habitat Survey and Waterfowl Production and Habitat Survey for southern
    Saskatchewan during 1961. The primary purpose of the breeding survey is to provide
    information on spring population size and trajectory for certain North American
    duck species, and the primary purpose of the production survey is to provide information
    on duck production from the mid-continent breeding areas. Survey methods, habitat
    and weather conditions; breeding population indices; production indices; and tables
    of population estimates, waterfowl broods, and late-nesting indices are provided.",nt"owner_org":
